import axios from 'axios'
import React, { Component, useNavigator } from 'react'
import { Table } from 'react-bootstrap'
import { Apiurl } from '../services/apirest'


export  class MyRoutes extends Component {

    state = {
      data : []
    }

    username = localStorage.getItem("username");

    Navigator = useNavigator();

    getRoutes = () => {
        let url = Apiurl + "/api/users/" + this.username + "/routes"
        axios.get(url)
        .then(res => {
            this.setState({data: res.data})
            console.log(res.data)
        })
      }

      componentDidMount() {
        this.getRoutes();
      }

      handelMapClick = (e) => {
        axios.get(Apiurl + "/api/routes/get" + this.state.data._id), { headers: { "token": localStorage.getItem("read_token") }}
        this.Navigator('/route/' + this.state.data._id)
      }

  render() {
    return (
      <div>
        <h1>MyRoutes</h1>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>id</th>
              <th>Line</th>
              <th>View</th>
              <th>Accion</th>
            </tr>
          </thead>
          <tbody>
            {this.state.data.map((Route) => {
              return (
                <tr key={Route._id}>
                  <td>{Route._id}</td>
                  <td>{Route.name}</td>
                  <td> <button className='btn btn-primary' type='button'  onClick={this.handelMapClick}>View</button></td>
                  <td>
                    <button className="btn btn-success" style={{"marginRight": "10px"}}>Edit</button>
                    <button className="btn btn-danger">Delete</button>
                  </td>
                </tr>
              )
            })}
          </tbody>
        </Table>
      </div>
    )
  }
}
